import React, { useState } from "react";
import { Link as RouterLink, useNavigate } from "react-router-dom";
import { LockOutlined, UserOutlined } from "@ant-design/icons";
import { BsFillEnvelopeFill } from "react-icons/bs";
import { Button, Form, Input } from "antd";
import { createUserWithEmailAndPassword } from "firebase/auth";
import { auth } from "../firebase";
import "./Signup.css";
const Signup = () => {
  const navigate = useNavigate();
  const [values, setvalues] = useState({
    fname: "",
    lname: "",
    email: "",
    pass: "",
    cPass: "",
  });

  const [errMsg, setErrMsg] = useState("");

  const handleSubmission = () => {
    if (
      !values.fname ||
      !values.lname ||
      !values.email ||
      !values.pass ||
      !values.cPass
    ) {
      setErrMsg("invalid data");
      return;
    } else if (values.pass !== values.cPass) {
      alert("password not match plz check");
      setErrMsg("password not match");
      return false;
    }
    setErrMsg("");
    createUserWithEmailAndPassword(auth, values.email, values.pass)
      .then((res) => {
        console.log(res);
        navigate("/");
      })
      .catch((err) => {
        console.log(err);
      });
    console.log(values);
  };
  return (
    <>
      <div className="">
        <div className="signup-form">
          <div className="inner-form">
            <h3>Baked AI</h3>
            <p>
              Join Friends of Baked AI and receive a 15% commission on all
              payments for paying customers you refer to{" "}
              <span>
                <RouterLink to="/">www.baked-ai.com!</RouterLink>
              </span>
            </p>
            <Form
              name="normal_login"
              className="login-form"
              initialValues={{ remember: true }}
            >
              <Form.Item
                name="firstName"
                rules={[
                  { required: true, message: "Please input your firstName!" },
                ]}
              >
                <Input
                  prefix={<UserOutlined className="site-form-item-icon" />}
                  placeholder="First name"
                  onChange={(event) =>
                    setvalues((prev) => ({
                      ...prev,
                      name: event.target.values,
                    }))
                  }
                />
              </Form.Item>
              <Form.Item
                name="LastName"
                rules={[
                  { required: true, message: "Please input your LastName!" },
                ]}
              >
                <Input
                  prefix={<UserOutlined className="site-form-item-icon" />}
                  placeholder="Last name"
                  onChange={(event) =>
                    setvalues((prev) => ({
                      ...prev,
                      lname: event.target.values,
                    }))
                  }
                />
              </Form.Item>
              <Form.Item
                name="Email"
                rules={[
                  { required: true, message: "Please input your Email!" },
                ]}
              >
                <Input
                  prefix={
                    <BsFillEnvelopeFill className="site-form-item-icon" />
                  }
                  placeholder="Email"
                  onChange={(event) =>
                    setvalues((prev) => ({
                      ...prev,
                      email: event.target.values,
                    }))
                  }
                />
              </Form.Item>
              <Form.Item
                name="password"
                rules={[
                  { required: true, message: "Please input your Password!" },
                ]}
              >
                <Input
                  prefix={<LockOutlined className="site-form-item-icon" />}
                  type="password"
                  placeholder="Password"
                  onChange={(event) =>
                    setvalues((prev) => ({
                      ...prev,
                      pass: event.target.values,
                    }))
                  }
                />
              </Form.Item>
              <Form.Item
                name="Confirm password"
                rules={[
                  {
                    required: true,
                    message: "Please input your Confirm password!",
                  },
                ]}
              >
                <Input
                  prefix={<LockOutlined className="site-form-item-icon" />}
                  type="password"
                  placeholder="Confirm password"
                  onChange={(event) =>
                    setvalues((prev) => ({
                      ...prev,
                      cPass: event.target.values,
                    }))
                  }
                />
              </Form.Item>
              <b className="errMsg">{errMsg}</b>
              <Form.Item>
                <Button
                  type="primary"
                  htmlType="submit"
                  block
                  className="login-form-button"
                  onClick={handleSubmission}
                >
                  Sign Up
                </Button>
              </Form.Item>
            </Form>
          </div>
        </div>
      </div>
    </>
  );
};

export default Signup;
